export default function Forms() {
    return <Component>
      <h2>form.</h2>
  </Component>;
}

const Component = styled.div`
  height: 290px;
  border-radius: 5px;
  background: hsl(255 100% 40% / 0.35);
  backdrop-filter: blur(18px);
  box-shadow: 0 18px 29px #00000018;
`;
